import HomeApp from "./route/private/HomeApp";
import PrivateRoute from "./route/private/PrivateRoute";
import PrivateRouting from "./route/private/PrivateRouting";
import PublicRoute from "./route/public/PublicRoute";
import PublicRouting from "./route/public/PublicRouting";

import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <Route exact={true} path="/" element={<PublicRouter />}>
          {PublicRouting.map((privateRoute, index) => {
            const { path, Component, exact } = privateRoute;
            return (
              <Route
                key={index}
                path={path}
                element={<Component />}
                exact={`${exact}`}
              />
            );
          })}
        </Route>
        <Route path="/" exact={true} element={<PrivateRouter />}>
          <Route path="/" element={<AppPatient />}>
            {RoutingPatient.map((routingPatient, index) => {
              const { path, Component, exact } = routingPatient;
              return (
                <Route
                  key={index}
                  path={path}
                  element={<Component />}
                  exact={`${exact}`}
                />
              );
            })}
          </Route>
        </Route>
        <Route path="/" exact={true} element={<PrivateRouterDoctor />}>
          <Route path="/" element={<AppDoctor />}>
            {RoutingDoctor.map((routingDoctor, index) => {
              const { path, Component, exact } = routingDoctor;
              return (
                <Route
                  key={index}
                  path={path}
                  element={<Component />}
                  exact={`${exact}`}
                />
              );
            })}
          </Route>
        </Route>
        <Route path="*" element={<ErrPage />} />
      </Routes>
    </Router>
  );
}

export default App;
